import "./Item.css";
import Date from "./Date";
import Card from "./Card";
function Item(props) {
  return (
    <Card className="card">
      {/* <div className="item"> */}
      <Date date={props.date}></Date> {/* multi-Component */}
      <p className="name">{props.name}</p>
      <p className="price">${props.price}</p>
      {/* </div> */}
      <br></br>
    </Card>
  );
}
export default Item;
